import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { Navigation } from "./components/navigation";
import { Header } from "./components/header";
import { Features } from "./components/features";
import { About } from "./components/about";
import { Team } from "./components/Team";
import { Contact } from "./components/contact";
import QuizPage from "./components/quiz";
import JsonData from "./data/data.json";
import SmoothScroll from "smooth-scroll";
import "./App.css";

export const scroll = new SmoothScroll('a[href*="#"]', {
  speed: 1000,
  speedAsDuration: true,
});

const App = () => {
  const [quizPageData, setQuizPageData] = useState({});
  useEffect(() => {
    setQuizPageData(JsonData);
  }, []);

  return (
    <Router>
      <Routes>
        <Navigation />
        <Route
          path="/"
          element={
            <div>
              <Header data={quizPageData.Header} />
              <Features data={quizPageData.Features} />
              <About data={quizPageData.About} />
              <Team data={quizPageData.Team} />
              <Team data={quizPageData.QuizPage} />
              <Contact data={quizPageData.Contact} />
            </div>
          }
        />
        <Route path="/quiz" element={<QuizPage />} />
      </Routes>
    </Router>
  );
};

export default App;
